import React, { PropsWithChildren } from "react";
import logo from "./logo.svg";
import "./App.css";
import Column from "./components/Column";
import Card from './components/Card'
import { AppContainer } from "./styles/styles";
import AddNewItem  from './components/AddNewItem'


const App = () => {
  const handle = () => {}
  return (
    <div className="App">
      <AppContainer>
        <Column text={"To do"}>
          <Card text = {'Initialize the app'} />
        </Column>
        <Column text={"In Progress"}>
          <Card text = {'Learning baba'} />
        </Column>
        <Column text={"Done"}>
          <Card text = {'Learning baba'} />
        </Column>
        <AddNewItem dark={true} toggleButtonText={'create'} 
        onAdd = {handle} />
      </AppContainer>
    </div>
  );
};

export default App;
